69c135b9d3b9d76ae286c0b4fb2c4f8283e28cba:
query NewsfeedQuery {
  topStory {
    ...StoryFragment
    id
  }
}

fragment StoryFragment on Story {
  title
  summary
  createdAt
  poster {
    __typename
    name
    profilePicture {
      url
    }
    ... on Node {
      __isNode: __typename
      id
    }
  }
  thumbnail {
    url
  }
}

